var title_f8_50_9004="Myopathy and biochemical defect";
var content_f8_50_9004=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F59733&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F59733&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Correlation of metabolic myopathy symptoms and signs with specific biochemical defects",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Static symptoms and signs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acid maltase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Branching enzyme deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Debranching enzyme deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Carnitine transport defect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        LCAD, VLCAD deficiencies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Trifunctional enzyme deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mitochondrial disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Dynamic symptoms and signs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Phosphoylase b kinase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myophosphorylase (PPL) deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Phosphofructokinase (PFK) deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Phosphoglycerate kinase (PGK) deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lactate dehydrogenase (LDH) deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Carnitine palmitoyltransferase II (CPT II) deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fatty acid oxidation/mitochondrial defects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Static and dynamic symptoms and signs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myophosphorylase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PFK, PPL b kinase deficiencies (plus fixed weakness)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Debranching enzyme deficiency (plus dynamic symptoms)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        LCAD, VLCAD, SCHAD deficiencies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Trifunctional enzyme deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Multiple mitochondrial DNA deletions",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LCAD: long-chain acyl-CoA dehydrogenase; VLCAD: very long-chain acyl-CoA dehydrogenase; SCHAD: short-chain 3-hydroxyacyl-CoA dehydrogenase.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
