"        Sedation is a side effect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cyclizine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dimenhydrinate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Diphenhydramine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hydroxyzine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
